import logo from './logo.svg';
import './styles/App.css';
import Header from './components/Header'
import Row from './components/Row'
import Upload from './components/Upload'
import Video from './components/Row'
import Title from './components/Row'
import Description from './components/Row'
import Comments from './components/Row'
import NextVideos from './components/Row'


function App() {
  return (
    <>
      <Header />
      <Row />
      <Upload />
      <Video />
      <Title />
      <Description />
      <Comments />
      <NextVideos />
    </>
  );
}

export default App;
